import Modal from "../../components/modal";
import Workshop from "../../components/formWorkshop";

export default function Workshopdd({ open, handleClose, onChange, addClient }) {
  return (
    <Modal
      open={open}
      handleClose={handleClose}
      renderContent={
        <AddClient
          onChange={onChange}
          addClient={addClient}
        />
      }
      width="40%"
    />
  );
}
